import React, { Component } from 'react'
import '../App.css'

 class main extends Component {
  render() {
    
    let className = props.changecolor ? 'changecolor' : ''
    return (
      <div>
      <h1 className={className}> Hello Adil</h1>
      </div>
    )
  }
}

export default main
